							"@tailwind base;\n@tailwind components;\n@tailwind utilities;\n\n/* Register the font faces */\n@font-face {\n\tfont-family: 'Lora';\n\tsrc: url('/fonts/lora-regular.ttf');\n\tfont-weight: normal;\n}\n\n@font-face {\n\tfont-family: 'Lora';\n\tsrc: url('/fonts/lora-bold.ttf');\n\tfont-weight: bold;\n}\n\n@font-face {\n\tfont-family: 'Microgramma';\n\tsrc: url('/fonts/microgramma-regular.ttf');\n\tfont-weight: normal;\n}\n\n@font-face {\n\tfont-family: 'Microgramma';\n\tsrc: url('/fonts/microgramma-bold.ttf');\n\tfont-weight: bold;\n}\n\n@font-face {\n\tfont-family: 'Montserrat';\n\tsrc: url('/fonts/montserrat-regular.ttf');\n}\n\n@font-face {\n\tfont-family: 'Montserrat';\n\tsrc: url('/fonts/montserrat-bold.ttf');\n\tfont-weight: bold;\n}\n\n/* Colors */\n:root {\n\t--black: #0a192d; /* Midnight Blue */\n\t--white: #fffbfb; /* Vanilla Icecream White (Lightly warmed for ease on eyes) */\n\t--carrier: #404a5a; /* Carrier Gray */\n\t--royal-blue: #204498; /* Royal Blue */\n\t--monarch-blue: #003057; /* Monarch Blue */\n\t--wisconsin-gray: #d6d5da; /* USS Wisconsin Grey */\n\t--barry-blue: #7b9ccf; /* Barry Blue */\n\n\tfont-family: 'Lora', serif;\n\tcolor: var(--black);\n\tfont-size: 12pt;\n\n\t-webkit-font-smoothing: antialiased;\n\ttext-rendering: geometricPrecision;\n}\n\nhtml {\n\tbackground-color: var(--white);\n}\n\n/*\n    The choice to make H1 and H3 the title elements then H2 and H4 the subtitle \n    elements was with SEO in mind. \n    \n    You might have expected to see the font sizes linearly scaling in proportion the\n    the H[value] of the header. However, it makes more to focus on order of importance\n    rather than size in this case. \n\n    In short H2 (subtitle 1) is a higher priority than H3 (title 2) and so even though it\n    has a smaller font size it still occupies the H2 element.\n*/\n\n.sans {\n\tfont-family: 'Montserrat', sans-serif;\n}\n\n.serif {\n\tfont-family: 'Lora', serif;\n}\n\n/* Title 1 and Title 2 */\nh1,\nh3 {\n\tfont-family: 'Microgramma', sans-serif;\n\tfont-style: normal;\n\tfont-weight: bold;\n\ttext-transform: uppercase;\n\tcolor: var(--monarch-blue);\n\tletter-spacing: -0.5px;\n}\n\nh1 {\n\tcolor: var(--royal-blue);\n\tfont-weight: 700;\n\tfont-size: 27pt;\n}\n\nh3 {\n\tfont-size: 18pt;\n}\n\n/* Subtitle 1 and Subtitle 2 */\nh2,\nh4 {\n\tfont-family: 'Montserrat', sans-serif;\n\tcolor: var(--black);\n}\n\nh2 {\n\tcolor: var(--monarch-blue);\n\tfont-weight: 700;\n\tfont-size: 16pt;\n}\n\nh4 {\n\tfont-size: 14pt;\n}\n\n/* H5 and H6 will default to just being bold paragraph types */\nh5,\nh6 {\n\tfont-family: 'Lora', serif;\n\tcolor: var(--black);\n\tfont-weight: 700;\n}\n\n/* Figcaptions */\nfigcaption {\n\tfont-family: 'Montserrat', sans-serif;\n\tfont-weight: 600;\n\tcolor: var(--carrier);\n\ttext-transform: uppercase;\n\tfont-size: 8pt;\n}\n\nfigcaption a {\n\tfont-family: 'Montserrat', sans-serif;\n\ttext-transform: uppercase;\n\tfont-size: 8pt;\n}\n\n/* Hyper Links */\na {\n\tcolor: var(--royal-blue);\n\ttext-decoration: underline;\n}\n\nh1,\nh2,\nh3,\nh4 {\n\tline-height: 1em;\n}\n\n/* Standard Spacing */\nsection > header {\n\tmargin: 24px 0px;\n}\n\nsection > header > h1,\nh3 {\n\tmargin-bottom: 10px;\n}\n\np {\n\tmargin: 16px 0px;\n\tline-height: 1.75em;\n}\n\nul,\nol {\n\tmargin: 24px 0px;\n\tmargin-left: 24px;\n\tlist-style: disc;\n}\n\nli {\n\tmargin: 8px 0px;\n\tline-height: 1.75m;\n}\n\n/* Standard container */\n.stdcontainer {\n\tpadding: 1rem 1.5rem;\n\tborder-radius: 1px;\n}\n\n.stdcontainer-sharp {\n\tpadding: 1rem 1.5rem;\n\tborder-radius: 0px;\n}\n\n.contentLoader {\n\theight: 550px;\n}\n",
